export const Category = () => {
    return (
            <div className="Category">
                    {/* <p>{title.title}</p> */}
                    <p><FontAwesomeIcon icon={faCircle} className="circle-icon"/> Shopping</p>
                    <div className="btn-wrapper"> 

                        <button type="button">
                            <FontAwesomeIcon icon={faPen} />
                            {/* onClick={() => editCategory(title.id)} */}
                        </button>
                        <button type="button">
                            <FontAwesomeIcon icon={faTrashCan} />
                            {/* onClick={() => deleteCategory(title.id)}  */}
                        </button>   
                    </div>                  
            </div>
    )
}
